import React, { useState, useEffect } from "react";
import { useForm } from "react-hook-form";
import { useTranslation } from "react-i18next";
import i18next from "i18next";
import { Route, Routes, Link } from "react-router-dom";
import Backbtn from '../images/back-btn.png'
const SelectCountry = () => {


    const { t } = useTranslation();
    const onChangeHandler = (e) => {
        const index = e.target.selectedIndex;
        const el = e.target.childNodes[index]
        const option =  el.getAttribute('id');  
        i18next.changeLanguage(option)
      }

      const {
        register,
        formState: { errors, isValid },
        handleSubmit,
        reset,
        watch,
        getValues,
    } = useForm({ mode: "onChange" });

    const onSubmit = (data) => {
        console.log(JSON.stringify(data));
    };
  return (
    <div className="reg">
        <Link to="/">
        <img className='back_btn' src={Backbtn} alt=" back btn" />
      </Link>
    <div className="reg_btns">
        <div className="reg_light"></div>
        <div className="reg_light active"></div>
    </div>

    <form className="reg_form" onSubmit={handleSubmit(onSubmit)}>
        <div className="block1">
        <select    {...register("Country", {
                            required: 'select a country',
                        })} name="country" className="form-control">
        <option  >{t('reg_country')}</option>
        <option value="kg">Кыргызстан</option>
        </select>
        <select className="form-control" {...register("Country")}>
        <option  >{t('reg_country')}</option>
        <option value="kg">Кыргызстан</option>
      </select>
      <input type="submit" />
        <div>
                 {errors?.Country && (
                        <p
                            style={{
                                color: "red",
                                marginTop: "10px",
                                paddingLeft: "15px",
                            }}
                        >
                            {errors?.Country?.message || "Error"}
                        </p>
                    )}
                 </div>
        </div>


        <div className="block2">
        {/* <select     {...register("City", {
                            required: 'select a city',
                        })} name="state" className="form-control">
                   <option >{t('reg_city')}</option>
                   <option value="bishkek">Бишкек</option>
                   <option value="osh">Ош</option>
                   <option value="batken">Баткен</option>
                   <option value="issyk-kyl">Ыссык-куль</option>
                   <option value="jalal-abad">Джалал-Абад</option>
                   <option value="naryn">Нарын</option>
                   <option value="talas">Талас</option>
                 </select> */}
                 <select className="form-control" {...register("City")}>
                 <option >{t('reg_city')}</option>

                 <option value="bishkek">Бишкек</option>
                   <option value="osh">Ош</option>
                   <option value="batken">Баткен</option>
                   <option value="issyk-kyl">Ыссык-куль</option>
                   <option value="jalal-abad">Джалал-Абад</option>
                   <option value="naryn">Нарын</option>
                   <option value="talas">Талас</option>
      </select>
      <input type="submit" />
                 <div>
                 {errors?.City && (
                        <p
                            style={{
                                color: "red",
                                marginTop: "10px",
                                paddingLeft: "15px",
                            }}
                        >
                            {errors?.City?.message || "Error"}
                        </p>
                    )}
                 </div>
        </div>
        <div className="block4">
            <button
                className="reg_submit btn"
                type="submit"
                disabled={!isValid}
            >
                {t("reg_submit")}
            </button>
        </div>

        <div className="block5">
            <p>
                {t("reg_checkReg")}{" "}
                <a
                    style={{
                        textDecoration: "none",
                        color: "#7F3A85",
                        cursor: "pointer",
                    }}
                    href=""
                >
                    {t("reg_login")}
                </a>{" "}
            </p>
        </div>
        <div className="block7">
            <select
                className="select-css"
                name="language"
                id="language"
                onChange={onChangeHandler}
            >
                <option
                    id="ky"
                    value="ky"
                >
                    кыргызча
                </option>

                <option
                 id="ru"
                    value="ru"
                >
                    русский
                </option>
            </select>
        </div>

    </form>
</div>
  )
}

export default SelectCountry
